import React, { useState } from 'react';
import './Home.css';

function Home() {
  const [showEmbeddedMap, setShowEmbeddedMap] = useState(false);

  return (
    <div className="home-container">
      <header className="header">
        <h1 className="title">AC/DC Charging Stations</h1>
      </header>

      <div className="toggle-container">
        <button
          className="map-button"
          onClick={() => setShowEmbeddedMap(!showEmbeddedMap)}
        >
          {showEmbeddedMap ? 'Back to List' : 'View Map'}
        </button>
      </div>

      {showEmbeddedMap ? (
        <div className="map-container">
          <iframe
            src="https://www.google.com/maps/d/u/0/embed?mid=1apUlJ2dUs9n4Q4fLHsDRH8vLnM0ObsM&ehbc=2E312F"
            width="100%"
            height="480"
            style={{ border: 0 }}
            allowFullScreen
            loading="lazy"
            title="Charging Stations Map"
          ></iframe>
        </div>
      ) : (
        <div className="station-list">
          <p>Click "View Map" to see the charging stations on the map.</p>
        </div>
      )}
    </div>
  );
}

export default Home;
